import React from 'react';

export default () => {
  return (
    <div>
      <h1 className="display-4">The Quiz Game</h1>
      <p className="lead">
        Just some questions to be answered. Different subjects involved. All for
        fun.
      </p>
      <p className="text-secondary">Version 1.0.0</p>
    </div>
  );
};
